import { getNews } from '../../store/actions/news/news-actions';

import './NewsHome.css';

class NewsHome extends Component {

    componentDidMount() {
        const { id, getNews } = this.props;
        getNews(id);
        // Axios.post('/news/get-news', {id})
        //   .then((response) => console.log(response.data.news))
        //     .catch((err) => console.log(err));
    }

    render() {
        return (
            <div className="news-home">
                <header>
                    <h1> Latest News </h1>
                    <span>  </span>
                </header>
                <div className="container">

                </div>
            </div>
        )
    }
}

const mapStateToProps = (state) => ({
    id: state.user.data.id
});

export default connect(mapStateToProps, { getNews })(NewsHome);
